webpackJsonp([0x952479b40896],{1576:function(a,e){a.exports={data:{markdownRemark:{html:'<p>"중독 된 것"이 잠시 흘렀고,이 두 사건에서 모순이 일어나기 시작했다. 남녀 간의 모순과 남편과 아내의 모순이 잘 설명되었다. 삶에는 모순이 많지 않고 사랑에서 많은 모순이 있습니다. 가끔은 사랑의 모순이 증오와 모순만큼 좋지 않다. 불쌍한 점은 대부분의 사람들이 사랑의 모순에서 벗어날 길이 없다는 것이지, 끝없는 모순 속에서 인간 본성을 벗어 버려야한다는 것이다. 사람들은 종종 사랑이 또한 증오를 가져올 수 있다는 것을 모릅니다. 이것은 많은 비극의 근본 원인입니다.</p>\n<p>"93 중국 개발 보고서"작업에 참여한 사람들의 목록은 약 70 명이며, 복단대 학교가 할 수있는 거대한 팀입니다. 이것은 또한 보고서의 강도를 보여줍니다.</p>\n<p>내 생각에 그러한 보고서를 작성하는 것이 중요하지만이 과정에서 팀을 키우는 것이 더 중요합니다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0023.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0023.md",frontmatter:{title:"2월 2일 수요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0023.md absPath of file >>> MarkdownRemark"}}}});
